import React from "react";

class List extends React.Component{
    state = {
        users:[
            {
                name:"test",
                age:20
            },
            {
                name:"test2",
                age:20
            },
            {
                name:"test3",
                age:20
            },
            {
                name:"test4",
                age:20
            }
        ]
    }

    render(){
        return <div>
            <ul>
               {this.state.users.map(item=>{
                return <li>{item.name}</li>
               })}
            </ul>
        </div>
    }
}

export default List
